import React from 'react';
import '../styles/bikeCard.css';

// Import edilen resmi buraya ekliyoruz
import AssistHybridElectricBike from '/assets/images/Assist-Hybrid-Electric-Bike.png';

const BikeCard = ({ bike }) => {
  return (
    <div className="bike-card">
      {/* Resmi import ettiğimiz şekilde kullanıyoruz */}
      <img src={AssistHybridElectricBike} alt={bike.model} className="bike-image" />
      <h3>{bike.model}</h3>
      <p>{bike.manufacturer}</p>
      <p className="price">${bike.price}</p>
    </div>
  );
};

export default BikeCard;
